  // вывод регионов
  function printOptions(optionList, selectId) {
    var list = optionList;
    var select = selectId;
    var curSelect = document.getElementById(select);

    for( var i = 0; i<list.length; i++ ) {
      option = curSelect.appendChild(document.createElement("option"));
      option.setAttribute('value', list[i].id);
      option.innerHTML = list[i].title;
    }
  };

// выбор страны в <select>
function selectCountry(select) {
  var id = select.options[select.selectedIndex].value;
  var provider = map.dataProvider;

  if ( '' === id ) {
    map.clickMapObject(map.dataProvider);
    var newProvider = map.getObjectById(id);
    regionList = newProvider.linkToObject.images;
    select_region.prop("disabled", false);
  } else if (id == "noneCountry" ) {
    map.dataProvider = worldDataProvider;
    handleGoHome();
    select_region.get(0).selectedIndex = 1;
    select_region.val('noneRegion').change();
    select_region.prop("disabled", true);
  } else if ( provider !==  worldDataProvider ) {
    map.dataProvider = worldDataProvider;
    map.clickMapObject(map.getObjectById(id));
    var newProvider = map.getObjectById(id);
    regionList = newProvider;
    regionList = newProvider.linkToObject.images;
    printOptions(regionList, "selectRegion");
    select_region.prop("disabled", false);
  } else {
      map.clickMapObject(map.getObjectById(id));
      var newProvider = map.getObjectById(id);
      regionList = newProvider;
      regionList = newProvider.linkToObject.images;
      printOptions(regionList, "selectRegion");
      select_region.prop("disabled", false);
  }
}

