// выбор производителя в <select>
	function selectBrand(select, list) {
    var id = select.options[select.selectedIndex].value;
    var brandName = $(".supplier-description .supplier-name");
    var brandLogo = $(".supplier-description .supplier-logo img");
    var brandText = $(".supplier-description .supplier-text");
    if ( 'noneBrand' == id ) {
      block.css({'visibility': 'hidden', 'height': '0'});
    }
    else {
      for(var i=0; i<brandsList.length; i++){
        if(brandsList[i].id == id){
          var brandsArr = brandsList[i];
          brandName.text(brandsArr.title);
          brandLogo.attr("src", brandsArr.brandLogoUrl); //setAttribute('value', list[i].id);
          brandText.text(brandsArr.brandText);
        }
      }
      block.css({'visibility': 'visible', 'height': 'auto'});
    }
	}

